import baseUrl from '../../Api/baseURL'
const AllCategoryPage = () => {

  const get = async ()=>{
      const res = await baseUrl.get('/api/v1/categories')
      console.log(res.data)
  }

  useE
  return (
    <div>
      <CategoryComponent />
      <ReactPagination />
    </div>
  )
}

export default AllCategoryPage
